import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';

const NavBar = () => {
  return (
    <div className="NavBar">
      <Navbar bg="dark col-sm-3" variant="dark">
        <Nav className="mr-auto">
          <Nav.Link href="#home" className="NavBarItems">Home</Nav.Link>
          <Nav.Link href="#features" className="NavBarItems">Features</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
        </Nav>
      </Navbar>
      <Navbar bg="dark col-sm-6" variant="dark">
        <Nav className="mr-auto">
          <Nav.Link href="#home" className="NavBarItems">Home</Nav.Link>
          <Nav.Link href="#features" className="NavBarItems">Features</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
          <Nav.Link href="#pricing" className="NavBarItems">Pricing</Nav.Link>
        </Nav>
      </Navbar>
    </div>
  );
};

export default NavBar;
